import React from "react";
import logo from "./res/logo.png";
import "./components/App.css";
import styled from "styled-components";
import Fade from "react-reveal/Fade";

const Logo = styled.img`
  width: 40%;
  margin-bottom: -200px;
`;

const Authors = styled.h5``;

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Fade top>
          <Logo src={logo} alt="Logo de Bonap" />
        </Fade>
        <Fade right>
          <Authors>LE FEYER Aymeric</Authors>
        </Fade>
        <Fade left>
          <Authors>CARRY Quentin</Authors>
        </Fade>
      </header>
    </div>
  );
}

export default App;
